import logo from './logo.svg';
import './App.css';

const data = [
  { name: "Verb Vanilla Latte", price: "2"},
  { name: "Verb Coconut Chai", price: "2"},
  { name: "Verb Cookie Butter", price: "2"},
  { name: "Verb Strawberry Rose Hibiscus", price: "2"},
  { name: "Bugs Bunny Sign", price: "5"},
  { name: "Ina Garten's Modern Comfort Food", price: "5"},
  { name: "Olive Oil", price: "5"},
];

function App() {
  return (
    <div className="App">
      <ProductList list={data} />
    </div>
  );
}

export default App;
